export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:h,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:h,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:i,pageSize:25,pageCount:i,total:5}}},waQQZbzHiD:{data:{id:603,attributes:{imdbId:"tt1024715",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTMxMDI4MTE0Ml5BMl5BanBnXkFtZTcwNTg0NDI3MQ@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.4\u002F10"},{Source:"Rotten Tomatoes",Value:"56%"},{Source:"Metacritic",Value:"47\u002F100"}],item_lang:{data:{id:1266,attributes:{title:c,plot:"Sex addict and colonial theme park worker, Victor Mancini, has devised a complicated scam to pay for his mom's hospital bills while she suffers from an Alzheimer's disease that hides the truth about his childhood. He pretends to choke on food in a restaurant and the person who \"saves\" him will feel responsible for Victor for the rest of their lives.",slug:"choke"}}},books:{data:[{id:4191,attributes:{title:c,description:j,thumbnail:k,authors:[a],firstBook:true,published:l,publisher:d,subtitle:f}},{id:4192,attributes:{title:c,description:j,thumbnail:k,authors:[a],firstBook:e,published:l,publisher:d,subtitle:f}},{id:4193,attributes:{title:c,description:"Victor Mancini est figurant dans un \" musée vivant \" où le moindre anachronisme est puni par la mise au pilori avec suspension de salaire. Il est sexoolique, drogué du sexe en thérapie verbale, incapable d'aimer. Son meilleur ami se promène avec des cailloux enroulés dans des couvertures et sa mère, folle à lier, le ruine sans jamais reconnaître en lui le fils dont elle a ravagé l'enfance... Pour quelles raisons ? Où se niche véritablement la folie ? Pourquoi Victor continue-t-il de se faire vomir publiquement dans des restaurants chics et qui saura lui révéler l'incroyable secret de sa naissance ? Un livre de Palahniuk ne se résume pas, c'est déjanté, subversif et incroyablement lucide.",thumbnail:g,authors:[a],firstBook:e,published:"2005-01-01",publisher:"Editions Gallimard",subtitle:g}},{id:4194,attributes:{title:"Haunted",description:"Haunted is a novel made up of twenty-three horrifying, hilarious, and stomach-churning stories. They’re told by people who have answered an ad for a writer’s retreat and unwittingly joined a “Survivor”-like scenario where the host withholds heat, power, and food. As the storytellers grow more desperate, their tales become more extreme, and they ruthlessly plot to make themselves the hero of the reality show that will surely be made from their plight. This is one of the most disturbing and outrageous books you’ll ever read, one that could only come from the mind of Chuck Palahniuk.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=89uQ5xufarYC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:e,published:"2005-05-03",publisher:d,subtitle:f}},{id:4195,attributes:{title:"Damned",description:"“As gleefully, vividly, hilariously obscene as you'd expect. . . . Irreverent and hugely entertaining.\" —NPR From the bestselling author of Fight Club comes a dark and brilliant satire about adolescence, Hell, and the Devil. Madison is the thirteen-year-old daughter of a narcissistic film star and a billionaire. Abandoned at her Swiss boarding school over Christmas, she dies over the holiday, presumably of a marijuana overdose. The last thing she remembers is getting into a town car and falling asleep. Then she's waking up in Hell. Literally. Madison soon finds that she shares a cell with a motley crew of young sinners: a cheerleader, a jock, a nerd, and a punk rocker, united by their doomed fate, like an afterschool detention for the damned. Together they form an odd coalition and march across the unspeakable landscape of Hell--full of used diapers, dandruff, WiFi blackout spots, evil historical figures, and one horrific call center--to confront the Devil himself.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=S9ar5ae1e9gC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:e,published:"2011-10-18",publisher:d,subtitle:g}}]}}},meta:{}}},prerenderedAt:1682568407432}}("Chuck Palahniuk","movie","Choke","Anchor",null,"A Novel","","series",1,"Victor Mancini, a medical-school dropout, is an antihero for our deranged times. Needing to pay elder care for his mother, Victor has devised an ingenious scam: he pretends to choke on pieces of food while dining in upscale restaurants. He then allows himself to be “saved” by fellow patrons who, feeling responsible for Victor’s life, go on to send checks to support him. When he’s not pulling this stunt, Victor cruises sexual addiction recovery workshops for action, visits his addled mom, and spends his days working at a colonial theme park. His creator, Chuck Palahniuk, is the visionary we need and the satirist we deserve.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=lo0cCD_eRygC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2002-07-30"))